import React , {useState} from "react"
import Calendar from 'react-calendar'
import 'react-calendar/dist/Calendar.css';
import './App.css';

function App() {
  const [but,setBut] = useState(false);
  const [date,setDate] = useState(new Date());
  const calChange = (e) =>{
     setDate(e); 
  }

  return (
    <div className="App">
       <button onClick={but?setBut(false):setBut(true)}>Show Calendar</button>
       {but?<Calendar onChange={calChange}/>:null}
       {but&&<p>{date}</p>}
    </div>
  );
}

export default App;
